const PictureContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  flex-grow: 1;
`;

const TaglineContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: ${props => props.theme.palette.primary1Color};
  color: ${props => props.theme.palette.white};
  height: 60px;
  padding: 0 10px;
`;

const Mood = (value, selectMood) => (
  <MoodWrapper>
    <WhiteFrame level={1} className='clickable'>
      <MoodContent onClick={() => selectMood(value.name)}>
        <PictureContainer >
          {moods[value.name]}
        </PictureContainer>
        <TaglineContainer >
          {value.tagline}
        </TaglineContainer>
      </MoodContent>
    </WhiteFrame>
  </MoodWrapper>
);

export default class Moods extends Component {
  render() {
    return (
        <MoodsContainer>
          {this.props.moods.map(a => Mood(a, this.props.selectMood))}
        </MoodsContainer>
    );
  }
}